import React, {Component} from 'react';
import './App.css';

class article extends Component {
    constructor(props) {
        super(props);
        this.state = {
            title: props.title,
            description: props.description,
            text: props.text,
            creationdate: props.creationdate,
            editdate: props.editdate,
            uid: props.uid
        };
    }

    render(value) {
        if(value == 'create')
        {
            return(
                <h1>Create</h1>
            )
        }
        else if (value == 'edit')
        {
            return(
                <h1>Edit</h1>
            )
        }
        else if (value == 'show')
        {
            return (
                <h1>Show</h1>
            )
        }
    }
}
